import React from "react";

function Mabuhay(){
    return(
        <div class="panuto-carousel panuto">
        <div class="">
            <img src="/assets/imgs/ingame/mabuhay.png" id="mabuhay-image" />
        </div>
        <a href="/panuto">
        <img src='/assets/imgs/ingame/sunod.png' id='sunod-image' />
        </a>
    </div>
    )
}

export default Mabuhay;
